import React from "react"
import { useAuth } from "../contexts/AuthContext"
import Sidebar from "./Sidebar"

export default function Dashboard(props) {
    const quizzesData = {
        "quizzes": [
            {
                "id": 0,
                "title": "This is my quiz",
                "questions": [
                    {
                        "question": "Why?",
                        "answers": [
                            "Cause yes", "Why not", "No", "Yes"
                        ],
                        "correctAnswer": "Yes"
                    }
                ]
            }
        ]
    }

    const {currentUser} = useAuth()

    const things = quizzesData.quizzes.map(quiz => {
        return <div className="quiz-sidebar-name" key={quiz.id}>{quiz.title}</div>
    })

    return (
        <div>
            
        </div>
        
    )
}
